Mathew Kearney (pronounced /Ãƒâ€¹Ã‹â€ kÃƒâ€°Ã¢â‚¬Ëœrni/; born December 1, 1978) is an American musician born in Eugene, Oregon, now based in Nashville, Tennessee. Kearney has received critical acclaim and widespread recognition for his Columbia Records debut, Nothing Left to Lose. So far, he has a total of four top 20 hits on the Adult Top 40 Chart.

His most recent album, Young Love, was released on August 2nd, 2011. The album's first single, &quot;Hey Mama,&quot; was released on May 10, 2011.



The Chicago EP is an EP album by Mat Kearney released in 2005 on Aware/Columbia Records to promote his then upcoming album Nothing Left To Lose (2006). It is a rare item and is now out of print.

